import Card from '../UI/Card'
import classes from './AvailableMeals.module.css'
import MealItem from './MealItem/MealItem'
const DUMMY_MEALS = [
    {
      id: 'm1',
      name: 'PURI',
      description: 'deepfried made from flour',
      price: 22.99,
    },
    {
      id: 'm2',
      name: 'RICE-SAMBAR',
      description: 'lentil vegetable soup with cooked rice',
      price: 16.5,
    },
    {
      id: 'm3',
      name: 'DOSA',
      description: 'Indians Fav',
      price: 12.99,
    },
    {
      id: 'm4',
      name: 'IDLI',
      description: 'All Time Love',
      price: 18.99,
    },
  ];

  const AvailableMeals = () => {
    const mealsList = DUMMY_MEALS.map((meal) => <MealItem key={meal.id} name={props.name}  description={meal.description} price={price.description}/>);
  
    return (
      <section className={classes.meals}>
        <Card>
        <ul>{mealsList}</ul>
        </Card>
      </section>
    );
  };
  
  export default AvailableMeals;
